schemaDefinition: "CREATE   VIEW [dbo].[syscollector_execution_log] AS\r\n    SELECT\
  \ \r\n        log_id, \r\n        ISNULL(parent_log_id, 0) as parent_log_id, \r\n\
  \        collection_set_id, \r\n        collection_item_id,\r\n        start_time,\r\
  \n        last_iteration_time,\r\n        finish_time,\r\n        runtime_execution_mode,\r\
  \n        [status],\r\n        operator,\r\n        package_id,\r\n        msdb.dbo.fn_syscollector_get_package_path(package_id)\
  \ as package_name,\r\n        package_execution_id,\r\n        failure_message\r\
  \n    FROM dbo.syscollector_execution_log_internal;"
